// Dashboard.js
const Dashboard = () => {
    return (
      <div className="grid grid-cols-3 gap-4">
        <div className="bg-white p-4 rounded shadow">Total Calls</div>
        <div className="bg-white p-4 rounded shadow">Messages</div>
        <div className="bg-white p-4 rounded shadow">Location Updates</div>
      </div>
    );
  };
  
  export default Dashboard;
